        <Row className="row s3 justify-content-center ">
          <Col className="col-12 s3">
            <h1 className="s3_h1">ROAD MAP</h1>
            {/* <hr className="line"/> */}
          </Col >
          <div className="line mt-5"></div>
        </Row>
        <div>
<Cara></Cara>
          </div>
      </div>
    </div>
  );
};

export default Section3;
